import React, { Component } from 'react';
import axios from 'axios';

class App extends Component {
    state = {}
    render() {
        return (
            <div>
                <h1>Hello</h1>
                <Register />
            </div>
        );
    }
}

export default App;



class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            user_reg: {
                username: '',
                password: '',
                email: '',
            }
        }
    }

    handleSubmit(event) {
        event.preventDefault();
        const user_reg = this.state.user_reg;
        axios.post('http://127.0.0.1:8000/api/user/create/', { user_reg })
            .then(res => {
                console.log(res)
                console.log(res.data)
            })
    }

    handleChange = event => {
        this.setState({ name: event.target.value });
    }

    render() {
        return (
            <form onSubmit={this.handleSubmit}>
                <input name='email' type='email' onChange={this.handleChange} placeholder='email'></input>
                <input name='username' type='text' onChange={this.handleChange} placeholder='username'></input>
                <input name='password' type='password' onChange={this.handleChange} placeholder='password'></input>
                <button type='submit'>Sign Up</button>
            </form>
        );
    }
}
